import React from 'react';

const Footer = () => {
    return (
        <footer className='bg-blue-300 max-w-full py-5'>
            <div className='max-w-screen-xl	flex justify-between  mx-auto text-xl'>
                <p><a href="#">Умови користування</a></p>
                <p>Технічна підтримка: +380 68 111 11 11</p>
                <p>ProSearch@gmail.com</p>
            </div>
        </footer>
    );
};

export default Footer;
